import CSS from "csstype";

export const progressBarContainer: CSS.Properties = {
    borderRadius: '100px', // Make the container rounded
    overflow: 'hidden', // Ensure the rounded corners are visible
    backgroundColor: '#e0e0e0', // Background color of the progress bar
    height: '30px', // Height of the container
    marginTop: '20px', // Spacing from other elements
};

// Define styles for the progress bar
export const progressBar: CSS.Properties = {
    appearance: 'none', // Remove default styling
    width: '100%', // Full width
    height: '100%', // Full height of the container
    borderRadius: '100px', // Rounded corners for the progress
};
